INSERT INTO `field_data_body` VALUES ('node','article',0,1,1,'und',0,'<p>News items are intended for content such as announcements, press releases and other time-specific information. News items are one of many content types you can display on your site. This news item is promoted to the front page.</p><p>To change your site\'s front page, click Configuration > Site Information.<br />To add another News item, click Add content > News item.</p><a href=\'http://www.drupalgardens.com/learnmore/news\' target=\'_blank\'>Learn more</a>','','safe_html');
INSERT INTO `field_data_body` VALUES ('node','page',0,6,6,'und',0,'<p>The About page is a Basic page customized to provide information about you or your organization. This basic page contains an embedded Google map and has a link to the About menu. You can edit this page to suit your needs, including changing the map location to your location.</p><p>To change the embedded map location:</p><ul><li>Open a new browser window and find a replacement location on http://maps.google.com.</li><li>When you have found a map, select \"Link\" at the top of the map, and follow the provided instructions.</li><li>On this page, click the Edit tab.</li><li>Click the HTML tab and paste the map copied from Google into the page body, replacing the old map.</li></ul><p>To add another Basic page, click Add content > Basic page.</p><p><a href=\'http://www.drupalgardens.com/learnmore/aboutus\' target=\'_blank\'>Learn more</a></p><iframe width=\"100%\" height=\"350\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"http://maps.google.com/maps?q=map+Hilda+Ramstraat+39+2600+Berchem+Belgium&amp;oe=utf-8&amp;ie=UTF8&amp;hq=&amp;hnear=Hilda+Ramstraat+39,+Berchem+2600+Antwerp,+Flemish+Region,+Belgium&amp;gl=us&amp;ei=1XfHS4O5LsGBlAeQwLzFAQ&amp;ved=0CAoQ8gEwAA&amp;ll=51.188752,4.421507&amp;spn=0.002122,0.005423&amp;t=h&amp;z=18&amp;output=embed\"></iframe><br /><small><a href=\"http://maps.google.com/maps?q=map+Hilda+Ramstraat+39+2600+Berchem+Belgium&amp;oe=utf-8&amp;ie=UTF8&amp;hq=&amp;hnear=Hilda+Ramstraat+39,+Berchem+2600+Antwerp,+Flemish+Region,+Belgium&amp;gl=us&amp;ei=1XfHS4O5LsGBlAeQwLzFAQ&amp;ved=0CAoQ8gEwAA&amp;ll=51.188752,4.421507&amp;spn=0.002122,0.005423&amp;t=h&amp;z=18&amp;source=embed\">View Larger Map</a></small>','','full_html');
INSERT INTO `field_data_body` VALUES ('node','article',0,11,11,'und',0,'<p>News items are intended for content such as announcements, press releases and other time-specific information. News items are one of many content types you can display on your site.</p><p>To change your site\'s front page, click Configuration > Site Information.<br />To add another News item, click Add content > News item.</p><a href=\'http://www.drupalgardens.com/learnmore/news\' target=\'_blank\'>Learn more</a>','','safe_html');
